import React from "react";
import { BrowserRouter, Router, Routes, Route } from "react-router-dom";
const App = () => {
    return ( <
        Router >
        <
        Routes >
        <
        Route path = "/"
        element = { < Home / > }
        /> <
        Route path = "/products"
        element = { < Products / > }
        /> <
        Route path = "/cart"
        element = { < Cart / > }
        /> <
        /Routes> <
        /Router>
    );
};

export default App;
